                                        TÉRMINOS Y CONDICIONES PARA EL INGRESO, REGISTRO Y USO DEL TUFACTORING SERVICIOS C.A.
                                    </p>

                                    <p class=""text-justify"">
                                        PRIMERO. En este documento  se establecen los términos y condiciones de uso del “Sistema Tufactoring “, en lo adelante “EL SISTEMA”, desarrollo tecnológico diseñado y operado por la sociedad mercantil TUFACTORING SERVICIOS C.A., domiciliada en la ciudad de Caracas, Distrito Capital, constituida por documento inscrito por ante el Registro Mercantil Cuarto de la Circunscripción Judicial del Distrito Capital y Estado Miranda, en fecha 23 de noviembre de 2007, bajo el N.º 51, Tomo 126, en lo adelante LA INSTITUCION. En este sentido, ");
            WriteLiteral(@"el material mostrado u ofrecido en este Sitio Web, (material gráfico, documentos, textos, imágenes, sonido, video, audio, las ilustraciones, etc.) son de la exclusiva propiedad de LA INSTITUCION.
                                    </p>
                                    <p class=""text-justify"">
                                        SEGUNDO: El registro en el Sistema implica la aceptación de los términos y condiciones establecidos en este Contrato, lo cual es indispensable para acceder, consultar o realizar cualquier operación en el presente Sitio Web.
                                    </p>
                                    <p class=""text-justify"">
                                        TERCERO: Para registrarse en EL SISTEMA se debe ser mayor de edad, civilmente hábil y residente en la República Bolivariana de Venezuela. Adicionalmente, para el registro en EL SISTEMA como CLIENTE, resulta imprescindible poseer una cuenta activa en los mismos bancos donde la INSTITUCION la tenga, no así en caso ");
            WriteLiteral(@"de registrarse como Proveedor o como Inversionista (ver Glosario). En estos dos últimos casos, el usuario queda informado y acepta, que el uso o participación de los servicios y operaciones en EL SISTEMA, no suponen el establecimiento de una relación comercial con el banco, hasta tanto no cumplan con todos los requisitos establecidos por este instituto bancario en los contratos que regulan sus productos y servicios, todo ello de conformidad con lo establecido en la legislación vigente.
                                    </p>
                                    <p class=""text-justify"">
