            WriteLiteral(@"ivados de, el uso, consulta o acceso por su parte en el Sistema desde equipos distintos a los normalmente utilizados. Tampoco se hace responsable LA INSTITUCION de fallas derivadas de los servicios de telefonía e Internet ni garantiza de forma alguna que el servicio del Sistema sea ininterrumpido o libre de error.
