                                    </p>
                                    <p class=""text-justify"">
                                        SEPTIMO: Estas condiciones generales se regirán e interpretarán de conformidad con leyes vigentes en la República Bolivariana de Venezuela. Las controversias que se deriven de las presentes condiciones generales, deberán ser interpuestas por ante los tribunales de la República Bolivariana de Venezuela.
                                    </p>

                                    <p class=""text-justify"">
                                        GLOSARIO
                                    </p>
                  ");
            WriteLiteral(@"                  <p class=""text-justify"">
                                        LA INSTITUCION: Corresponde a la persona jurídica confirmante de la operación, la cual notifica el pago a EL INVERSIONISTA ganador de la operación de confirming (pago a proveedores), una vez que llegue(n) al vencimiento la(s) factura(s) por la que haya ofertado y se encuentren disponibles los fondos en la cuenta del CLIENTE.
                                    </p>
                                    <p class=""text-justify"">
                                        SISTEMA TUFACTORING (ó Sistema): Corresponde a un Desarrollo Tecnológico que permite a EL CLIENTE, a través del uso de los canales de banca por internet, realizar operaciones de registro, venta, compra, ordenar el pago o ceder Facturas de sus proveedores, así como intercambiar información exclusivamente relacionada con dichas Facturas.
                                    </p>
                                    <p class=""text-justify"">
                         ");
            WriteLiteral(@"               EL CLIENTE: Es la persona natural o jurídica titular de una cuenta o de cualquier otro servicio o producto ofrecido por un banco quien, luego de cumplir las formalidades propias de afiliación al Sistema TuFactoring, conforme al procedimiento señalado a tal efecto, quien, siendo aceptante o deudor de una o varias facturas, registre dichos instrumentos en el Sistema de manera que pudieran ser objeto de subasta para el pago anticipado de las mismas a sus proveedores.
                                    </p>
                                    <p class=""text-justify"">
                                        INVERSIONISTA. Es la persona natural o jurídica que se convierte en acreedora de El CLIENTE como consecuencia de transacciones de compra de Facturas expedidas por EL PROVEEDOR originario, y a favor de quien este último acepta su cesión una vez que acepta el descuento ofertado por el Valor Neto de la factura subastada.
                                    </p>
                                ");
            WriteLiteral(@"    <p class=""text-justify"">
