                                    <p class=""text-center""> <u>DEFINICIONES</u> </p>

                                    <p class=""text-justify"">
                                        Para todos los efectos y consecuencias derivadas de la aplicación y alcance de este contrato y con el fin de lograr una correcta y exacta interpretación de este documento las siguientes palabras, utilizadas en singular o plural, mayúsculas o minúsculas, resaltadas o no, femenino o masculino, y salvo que el contexto lo requiera de otra forma, las palabras o expresiones definidas en singular incluirán su forma plural y viceversa, teniendo todas ellas el único y exclusivo significado que se indica a");
            WriteLiteral(@" continuación:
                                    </p>
                                    <p class=""text-justify"">
                                        EMPRESA: Corresponde a la sociedad mercantil TUFACTORING SERVICIOS C.A., en adelante LA INSTITUCION domiciliada en la ciudad de Caracas, Distrito Capital, constituida por documento inscrito por ante el Registro Mercantil Cuarto de la Circunscripción Judicial del Distrito Capital y Estado Miranda, en fecha 23 de noviembre de 2007, bajo el N.º 51, Tomo 126, creadora, propietaria y operadora del SISTEMA TUFACTORING, Corresponde a la persona jurídica confirmante de la operación, la cual garantiza el pago a EL INVERSIONISTA ganador de la operación de confirming (pago a proveedores), una vez que llegue(n) al vencimiento la(s) factura(s) por la que haya ofertado
                                    </p>
                                    <p class=""text-justify"">
                                        SISTEMA TUFACTORING (ó Sistema): Corresponde a un Desar");
            WriteLiteral(@"rollo Tecnológico que permite a EL CLIENTE, a través del uso de los canales de banca por internet, realizar operaciones de registro, venta, compra, ordenar el pago o ceder Facturas de sus proveedores, así como intercambiar información exclusivamente relacionada con dichas Facturas.
                                    </p>
                                    <p class=""text-justify"">
                                        INVERSIONISTA. Es la persona natural o jurídica que se convierte en acreedora de El CLIENTE como consecuencia de transacciones de compra de Facturas expedidas por EL PROVEEDOR originario, y a favor de quien este último acepta su cesión una vez que acepta el descuento ofertado por el Valor Neto de la factura subastada.
                                    </p>
                                    <p class=""text-justify"">
                                        EL CLIENTE: Es la persona natural o jurídica   quien, luego de cumplir las formalidades propias de afiliación al Sistema TuFactorin");
            WriteLiteral(@"g, conforme al procedimiento señalado a tal efecto, quien siendo aceptante o deudor de una o varias facturas, registre dichos instrumentos en el Sistema de manera que pudieran ser objeto de subasta para el pago anticipado de las mismas a sus proveedores.
                                    </p>
                                    <p class=""text-justify"">
                                        PROVEEDOR. Es la persona natural o jurídica acreedora de EL CLIENTE como consecuencia de transacciones comerciales consistentes en la venta o suministro de bienes y/o servicios, por lo cual ha expedido una Factura cuyo pago está a cargo de EL CLIENTE.
                                    </p>
                                    <p class=""text-justify"">
                                        DESCUENTO: A los únicos efectos de este contrato, corresponde a la cantidad resultante de aplicar la siguiente fórmula, al momento de efectuar las operaciones de venta de factura a través del Sistema:
                         ");
            WriteLiteral(@"           </p>
                                    <p class=""text-justify"">
                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(VNXTD)<br />
                                        D=_________ND<br />
                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(360)

                                    </p>
                                    <p class=""text-justify"">
                                        Donde ""D"" significa Descuento, ""VN"" significa Valor Neto, ""TD"" significa Tasa de Descuento; ""ND"" significa el número de días que resulte de sumar los días naturales desde e inclusive la fecha en que se entregue al Proveedor el Precio de venta, respecto de un Derecho Adquirido, hasta inclusive la fecha de vencimiento de dicho derecho de Crédito.
                                    </p>
                                    <p class=""text-justify"">
                                        TASA DE DESCUENTO: Corresponde a la tasa aceptada por EL PROVEEDOR para ");
            WriteLiteral(@"determinar el Descuento que se va a aplicar al Valor Neto de la factura subastada, entre las distintas ofertas realizadas por los distintos Inversionistas participantes durante horario en que se encuentre activo el Mercado Electrónico. El cálculo del Descuento se realizará desde la fecha en que se efectúe el anticipo de fondos, hasta la fecha del vencimiento de la Factura.
                                    </p>
                                    <p class=""text-justify"">
                                        FACTURA: Corresponde al documento o título de carácter mercantil contentivo de una obligación de pago con ocasión de la adquisición de bienes o servicios por parte de EL CLIENTE.
                                    </p>
                                    <p class=""text-justify"">
                                        MONTO NOMINAL O VALOR NOMINAL. Se refiere al valor numérico expresado en el texto de la Factura, que debe ser cargado por el CLIENTE en el Sistema
                               ");
            WriteLiteral(@"     </p>
                                    <p class=""text-justify"">
                                        VALOR NETO. Se refiere al monto resultante de restar al valor numérico expresado en el texto de la Factura todos los tributos o retenciones a los que hubiere lugar, incluso las notas de crédito, si existiesen. Dicho valor debe ser cargado por EL CLIENTE en el Sistema. En el caso del pago al vencimiento, LA INSTITUCION podrá proceder a pagar dicho valor a EL PROVEEDOR o a EL INVERSIONISTA o LA INSTITUCION misma, en caso de haberla comprado LA INSTITUCION, mediante cargo del monto correspondiente en la(s) cuenta(s) de EL CLIENTE.
                                    </p>
                                    <p class=""text-justify"">
                                        PRECIO DE VENTA: Corresponde al resultado de haber deducido del valor neto de las facturas, antes explicado, la tasa de descuento ofertada por EL INVERSIONISTA ganador en la respectiva operación, y la cual fue aceptada por EL PROVEE");
            WriteLiteral(@"DOR.
                                    </p>
                                    <p class=""text-justify"">
                                        CLAVES DE ACCESO: Corresponde a un mecanismo de Seguridad de la Información Electrónica, constante de factores de autenticación tendentes a verificar la identidad de EL INVERSIONISTA y la cualidad de éstos para realizar las operaciones propias del SISTEMA TUFACTORING. Estos factores de autenticación corresponderán a aquellos establecidos como Factor de autenticación categorías 2 y 3 de acuerdo a la Resolución Nº 641.10 emanada de la Superintendencia de las Instituciones del Sector Bancario (SUDEBAN) contentiva de las “Normas que Regulan el Uso de los Servicios de la Banca Electrónica”, publicada en la Gaceta Oficial de la República Bolivariana de Venezuela Nº 39.597 de fecha 19 de enero de 2011.
                                    </p>
                                    <p class=""text-justify"">
                                        DÍAS HÁBILES BANCARIOS: ");
            WriteLiteral(@"Corresponde a los días comprendidos entre lunes y viernes que, conforme al calendario bancario, sean laborables para los bancos.
                                    </p>
                                    <p class=""text-justify"">
                                        DERECHO DE CRÉDITO: corresponde al derecho que tiene el acreedor de una deuda QUE EL CLIENTE tiene obligación de pagar conforme a la Factura.
                                    </p>
                                    <p class=""text-justify"">
                                        GASTO POR SERVICIO: Corresponde al monto que obtendrá LA INSTITUCION con ocasión a la operación efectiva de la venta de Factura a El INVERSIONISTA. Este monto corresponderá al resultado de la fórmula aplicable sobre el valor de cada Factura, que será descontado del precio de venta que recibirá EL PROVEEDOR. Este valor puede ser consultado en la página del Sistema.
                                    </p>
                                    <p class=""text-ju");
            WriteLiteral(@"stify"">
                                        GASTOS BANCARIOS: corresponda a los porcentajes o valores cobrados por una institución bancaria originados por movimientos créditos o débitos en cuentas, así como por servicios prestados
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA PRIMERA:</b></u> Mediante el registro en el Sistema Tufactoring y la aceptación del presente contrato de adhesión, EL INVERSIONISTA manifiesta su interés en participar en subastas para la compra de Facturas registradas previamente en el Sistema Tufactoring, en el marco de una operación de confirming (pago a proveedores). En virtud de ello, EL INVERSIONISTA acepta expresamente las particularidades y condiciones expresadas en este instrumento.
                                    </p>
                                    <p class=""text-justify"">
                                        La operación en la que participaría E");
            WriteLiteral(@"L INVERSIONISTA consiste en que EL PROVEEDOR (a quien EL INVERSIONISTA podrá o no conocer)  una vez que haya aceptado la mejor oferta que arroje el Sistema Tufactoring con base en los descuentos propuestos por los distintos inversionistas, transmitirá a favor de EL INVERSIONISTA ganador todos los derechos de crédito inherentes a la factura y LA INSTITUCION realizará a este último el pago de la factura a su vencimiento por el valor neto que presenta el Sistema, una vez EL CLIENTE deposite y sean debitados los fondos en la cuenta bancaria asignada para el pago a EL INVERSIONISTA.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b> CLÁUSULA SEGUNDA:</b></u> EL INVERSIONISTA una vez registrado en el sistema, podrá participar en el mismo ofertando por la compra de facturas registradas por los clientes y autorizadas para su venta por los proveedores respectivos, dentro de los parámetros que el propio Sistema Tufactor");
            WriteLiteral(@"ing fija.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA TERCERA:</b></u> EL INVERSIONISTA acepta que el pago del Precio de venta deberá realizarse en la cuenta de LA INSTITUCION destinada para depositar todos los importes correspondientes a los fondos provenientes de la liquidación de la operación de venta de Facturas, así como también el monto por concepto del los GASTOS DE SERVICOS identificados en el sistema.
                                    </p>
                                    <p class=""text-justify"">
                                        EL INVERSIONISTA asume las tarifas bancarias establecidas por el Banco Central de Venezuela por concepto de transferencia de fondos al momento en que se realice el pago, los GASTOS BANCARIOS, así como impuestos actuales y futuros por concepto de débitos bancarios. En cualquier caso, de hacerse el pago a través de una transferencia por no disponer ");
            WriteLiteral(@"EL INVERSIONISTA de cuenta en el mismo banco donde LA INSTITUCION la posee, LA INSTITUCION no será responsable de cualquier mal funcionamiento del sistema de transferencias bancarias.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA CUARTA:</b></u> EL INVERSIONISTA está en pleno conocimiento que compite en una puja en la que participan otros inversionistas, siendo informado por el sistema en el momento en que su oferta ha sido aceptada por EL PROVEEDOR. En consecuencia, EL INVERSIONISTA acepta que, no obstante, realice la mejor oferta, EL PROVEEDOR pudiera rechazarla sin que ello motive compensación ni indemnización alguna
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA QUINTA:</b></u> El Precio de venta que pagará EL INVERSIONISTA ganador, será el que se obtenga en el Sistema TuFactoring, ");
            WriteLiteral(@"aplicando al Valor Neto de la factura la tasa de descuento ofertada EL INVERSIONISTA ganador y aceptada por EL PROVEEDOR.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA SEXTA:</b></u> EL INVERSIONISTA está en conocimiento que EL PROVEEDOR tendrá hasta sesenta (60) minutos después del cierre de la jornada para aceptar la venta, en caso contrario se tendrá como rechazada la oferta. En este punto, se indica que el horario del sistema es el siguiente: Para operaciones de consulta las 24 horas del día y los 365 días del año; para afiliación en el sistema  o registro de facturas, en los días hábiles bancarios en horario comprendido de 8:00 a.m. a 3:00 p.m.; y para la oferta de facturas, en horario comprendido de 8:00 a.m. a 12:00 p.m.; siempre y cuando no existan fallos o suspensiones del servicio electrónico, eléctrico o cualquier otra causa de fuerza mayor que imposibilite su empleo.
                 ");
            WriteLiteral(@"                   </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA SÉPTIMA:</b></u> EL INVERSIONISTA acepta que bastará sólo con la comunicación que por el Sistema Tufactoring reciba respecto a que su oferta fue aceptada para realizar el pago en un plazo máximo de sesenta (60) minutos. Una vez transcurrido dicho lapso sin que se haya verificado el pago, la operación queda anulada y EL INVERSIONISTA será bloqueado en El Sistema, debiendo asumir los gastos administrativos inherentes a la operación.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA OCTAVA:</b></u> LA INSTITUCION podrá verificar en todo momento a las personas naturales o jurídicas que se registren como inversionistas en el Sistema Tufactoring, reservándose el derecho de rechazar su inclusión en el sistema sin necesidad de declaración o resolución judicial, en caso ");
            WriteLiteral(@"de que EL INVERSIONISTA sea objeto de medidas o de investigación por parte de algún organismo o institución, nacional o internacional, encargado de la Prevención de legitimación de capitales o lavado de activos o por cualquier causa que razonablemente pudiera comprometer la seguridad de los clientes.
